import React from 'react'

export default function TraitJaune() {
  return (
    <p className='sup480:h-[calc(100%-8px)] sup480:top-[2px] sup768:h-[calc(100%-21px)] sup768:top-[12px] sup1024:h-[calc(100%-26px)] sup1024:top-[14px] sup1600:h-[calc(100%-41px)] sup1600:top-[27px] absolute w-[5px] h-[calc(100%-18px)] bg-jaune top-[13px] left-0'></p>
  )
}
